text:
@nikolamotor @CNHIndustrial @IVECO @IVECOUK #Hydrogen isnt sustainable or renewable

Commercial hydrogen (H2) is made from #fossilfuels

Producing 1 tonne of hydrogen releases 11 tonnes of CO2

Using 1 tonne of hydrogen releases 9 tonnes of steam (as potent as CO2)

1 tonne of H2 =&gt; 20 tonnes of #greenhouse gases

@UCSUSA
